void B_IO_L1_in_intra_trans(int idx, int idy, int c0, int c1, int c2, B_t4 local_B[1][2], hls::stream<float> &fifo_B_local_out, bool intra_trans_en) {
#pragma HLS INLINE OFF
  /* Variable Declaration */
  int p0 = idx, p1 = idy; // module id
  ap_uint<32> data_split[4];
  #pragma HLS ARRAY_PARTITION variable=data_split complete
  /* Variable Declaration */

  if (!intra_trans_en) return;


  // io_L1
  // pe
  for (ap_uint<7> c6 = 0; c6 <= 63; c6 += 1) {
    // latency
    for (ap_uint<2> c7 = 0; c7 <= 1; c7 += 1) {
      // latency
      for (ap_uint<4> c8 = 0; c8 <= 7; c8 += 1) {
      #pragma HLS PIPELINE II=1
        // simd
        {
          B_t4 in_data;
          B_t1 out_data;
          in_data = local_B[0][c8 / 4];
          for (ap_uint<3> n = 0; n < 4; n++) {
          #pragma HLS UNROLL
            data_split[n] = in_data(31, 0);
            in_data = in_data >> 32;
          }
          int split_idx = (c8) % 4;
          union {unsigned int ui; float ut;} u;
          u.ui = (unsigned int)data_split[split_idx];
          out_data = u.ut;
          fifo_B_local_out.write(out_data);
        }
      }
    }
  }
}
