void C_IO_L3_in(C_t16 *C, hls::stream<C_t4> &fifo_C_local_out) {
#pragma HLS INLINE OFF
  /* Variable Declaration */
  C_t4 data_split[4];
  #pragma HLS ARRAY_PARTITION variable=data_split complete
  /* Variable Declaration */

  for (ap_uint<8> c0 = 0; c0 <= 127; c0 += 1)
    for (ap_uint<4> c1 = 0; c1 <= 5; c1 += 1)
      for (ap_uint<3> c2 = 0; c2 <= 3; c2 += 1) {
        // array
        // io_L3
        for (ap_uint<7> c3 = 0; c3 <= 63; c3 += 1) {
          // io_L2
          for (int c4 = 0; c4 <= min(7, -8 * c1 + 41); c4 += 1) {
            // io_L1
            for (ap_uint<4> c5 = 0; c5 <= 7; c5 += 1) {
              // access_coalesce
              for (ap_uint<7> c6 = 0; c6 <= 63; c6 += 1) {
              #pragma HLS PIPELINE II=1
                {
                  C_t16 in_data;
                  C_t4 out_data;
                  if (c6 % 4 == 0) {
                    in_data = C[((64 * c1 + 8 * c4 + c5) * 256 + 4 * c6) / 16];
                    for (ap_uint<3> n = 0; n < 4; n++) {
                    #pragma HLS UNROLL
                      data_split[n] = in_data(127, 0);
                      in_data = in_data >> 128;
                    }
                  }
                  int split_idx = (4096*c1 + 512*c4 + 64*c5 + c6) % 4;
                  out_data = data_split[split_idx];
                  fifo_C_local_out.write(out_data);
                }
              }
            }
          }
        }
      }
}
