/* Module Definition */
void PE(int idx, int idy, hls::stream<A_t4> &fifo_A_in, hls::stream<A_t4> &fifo_A_out, hls::stream<float> &fifo_B_in, hls::stream<C_t4> &fifo_C_in, hls::stream<float> &fifo_D_1_in, hls::stream<float> &fifo_D_1_out, hls::stream<float> &fifo_D_drain_out) {
#pragma HLS INLINE OFF
  /* Variable Declaration */
  int p0 = idx, p1 = idy; // module id
  A_t1 local_A[1][1][4];
  #pragma HLS ARRAY_PARTITION variable=local_A dim=0 complete
  B_t1 local_B[1][1];
  #pragma HLS ARRAY_PARTITION variable=local_B dim=0 complete
  C_t1 local_C[1][4];
  #pragma HLS ARRAY_PARTITION variable=local_C dim=0 complete
  D_t1 local_D[2][8];
  #pragma HLS RESOURCE variable=local_D core=RAM_2P_BRAM
  /* Variable Declaration */

  for (ap_uint<8> c0 = 0; c0 <= 127; c0 += 1)
    for (ap_uint<4> c1 = 0; c1 <= 5; c1 += 1) {
      if (p1 == 0 && p0 + 8 * c1 <= 41) {
        // array
        // pe
        // latency
        for (ap_uint<2> c6 = 0; c6 <= 1; c6 += 1) {
          // latency
          for (ap_uint<4> c7 = 0; c7 <= 7; c7 += 1) {
          #pragma HLS PIPELINE II=1
            local_D[c6][c7] = 0;
          }
        }
      }
      if (p0 + 8 * c1 <= 41)
        for (ap_uint<3> c2 = 0; c2 <= 3; c2 += 1) {
          // array
          // pe
          for (ap_uint<7> c6 = 0; c6 <= 63; c6 += 1) {
            // latency
            for (ap_uint<2> c7 = 0; c7 <= 1; c7 += 1) {
              // latency
              for (ap_uint<4> c8 = 0; c8 <= 7; c8 += 1) {
              #pragma HLS PIPELINE II=1
                {
                  {
                    A_t4 fifo_data;
                    fifo_data = fifo_A_in.read();
                    for (ap_uint<3> n = 0; n < 4; n++) {
                    #pragma HLS UNROLL
                      union {unsigned int ui; float ut;} u;
                      u.ui = (unsigned int)fifo_data(31, 0);
                      local_A[0][0][n] = u.ut;
                      fifo_data = fifo_data >> 32;
                    }
                  }
                  local_B[0][0] = fifo_B_in.read();
                  {
                    C_t4 fifo_data;
                    fifo_data = fifo_C_in.read();
                    for (ap_uint<3> n = 0; n < 4; n++) {
                    #pragma HLS UNROLL
                      union {unsigned int ui; float ut;} u;
                      u.ui = (unsigned int)fifo_data(31, 0);
                      local_C[0][n] = u.ut;
                      fifo_data = fifo_data >> 32;
                    }
                  }
                  if (p1 + 64 * c2 >= 1 && c6 == 0)
                    local_D[c7][c8] = fifo_D_1_in.read();
                  // simd
                  for (ap_uint<3> c9 = 0; c9 <= 3; c9 += 1) {
                  #pragma HLS UNROLL
                    local_D[c7][c8] = (local_D[c7][c8] + ((local_A[0][0][c9] * local_B[0][0]) * local_C[0][c9]));
                  }
                  if (p1 == 63 && c2 == 3 && c6 == 63) {
                    fifo_D_drain_out.write(local_D[c7][c8]);
                  } else if (p1 + 64 * c2 <= 254 && c6 == 63) {
                    fifo_D_1_out.write(local_D[c7][c8]);
                  }
                  {
                    A_t4 fifo_data;
                    union {unsigned int ui; float ut;} u3, u2, u1, u0;
                    u3.ut = local_A[0][0][3];
                    u2.ut = local_A[0][0][2];
                    u1.ut = local_A[0][0][1];
                    u0.ut = local_A[0][0][0];
                    fifo_data = (ap_uint<32>(u3.ui), ap_uint<32>(u2.ui), ap_uint<32>(u1.ui), ap_uint<32>(u0.ui));
                    fifo_A_out.write(fifo_data);
                  }
                }
              }
            }
          }
        }
    }
}
